import React from 'react';
import ReactDom from 'react-dom';

// const element = React.createElement('h2', 'h2', 'Hello world!');

const AppHeader = () => {
  return (
    <h1> Science proves there are six ways you can learn and retain something faster.</h1>
  );
}

const AppList = () => {
  const items = ['teach', 'love', 'repeat'];

  return (
    <ul>
        <li>Teach Someone Else (Or Just Pretend To).</li>
        <li>Learn In Short Bursts of Time.</li>
        <li>Take Notes By Hand.</li>
        <li>Use The Power of Mental Spacing.</li>
        <li>Take A Study Nap.</li>
        <li>Change It Up.</li>
      </ul>
  );
}

  const App = () => {
    return (
    <React.Fragment>
      <AppHeader />
      <AppList />
    </React.Fragment>
    )
  }

ReactDom.render(<App />, document.getElementById('root'));
